"use strict";

/*
    Для списка простых ответов:
        Цифры 1-9 выбирают соответствующую резолюцию в списке БЕЗ отправки.
        Буквы в таком же порядке как и цифры выбирают резолюцию и нажимают Готово (отправляют):
        Ф, Ы, В, А, П, Р, О, Л, Д (или латинские: A, S, D, F, G, H, J, K, L)

    Для списка ответов, где есть раскрываемые (под)категории:
        Нажатие любой указанной выше клавиши раскрывают список категорий и
        прокручивает окно браузера к первой в списке.

    Клавиша Pause - выкл/вкл работу клавиш, описанных выше. Иными словами: выкл/вкл работу этого скрипта.

    Ниже указан список клавиш, которые нажимают Готово:
        Пробел, Enter, Enter на цифровом блоке (нумпаде).
        Можно добавить свои клавиши и/или убрать ненужные.

    Названия других клавиш смотреть в блоке "e.code" здесь: https://keyjs.dev/
*/
